import styles from "../styles/scss/header.module.scss";

import Link from "next/link";
import classnames from "classnames";
import { useState, useEffect } from "react";
import {useSelector,useDispatch} from "react-redux";
import signIn from "../components/actions/loginActions"

const Header = () => {
  const [hideMenuItems, setHideMenuItems] = useState(true);
  const dispatch = useDispatch()

  const toggleMobileMenu = () => {
    setHideMenuItems(!hideMenuItems);
  };

  const testExpress = async () => {
    // const resJson = await fetch("http://localhost:8000/")
    //   .then((resJson) => resJson.json())
    //   .catch((err) => console.log(err));
    // console.log("no error");
    // console.log(resJson);
    // console.log("here");
  };

  const login = useSelector(state => state.login)

  console.log(login)

  useEffect(() => {
    testExpress();
  }, []);

  return (
    <main className={styles.headerContainer}>
      <section className={styles.logoSection}>
        <Link href="/">
          <a>
            <img src="/images/logo.jpg" alt="YT Workflow" />
          </a>
        </Link>
      </section>
      <div
        className={classnames({
          [styles.mobileBackDrop]: true,
          [styles.showMobileBackdrop]: !hideMenuItems,
        })}
        onClick={toggleMobileMenu}
      ></div>
      <nav className={styles.menuSection}>
        <div
          className={classnames({ [styles.toggleIcon]: true })}
          onClick={toggleMobileMenu}
        >
          <div></div>
          <div></div>
          <div></div>
        </div>
        <ul className={classnames({ [styles.hideMenuUl]: hideMenuItems })}>
          {/* Home, Plans, Features, Contact */}

          <Link href="/">
            <a>
              <li
                className={classnames({ [styles.toggleIcon]: true })}
                onClick={toggleMobileMenu}
              >
                <div></div>
                <div></div>
                <div></div>
              </li>
            </a>
          </Link>
          <Link href="/">
            <a>
              <li>
                Home
                <div className={classnames({ [styles.after]: true })}></div>
              </li>
            </a>
          </Link>

          <Link href="/">
            <a>
              <li>
                Plans
                <div className={classnames({ [styles.after]: true })}></div>
              </li>
            </a>
          </Link>
          <Link href="/">
            <a>
              <li>
                Features
                <div className={classnames({ [styles.after]: true })}></div>
              </li>
            </a>
          </Link>
          <Link href="/">
            <a>
              <li>
                Contact
                <div className={classnames({ [styles.after]: true })}></div>
              </li>
            </a>
          </Link>

          <Link href="/">
            <a>
              <li>
                Sign In
                <div className={classnames({ [styles.after]: true })}></div>
              </li>
            </a>
          </Link>
        </ul>
      </nav>
      <section className={styles.authSection}>
        <ul>
          {/* Sign In, Sign Up */}
          <Link href="/sign-up" onClick={()=>{dispatch(signIn())}}>
            <a>
              <li className={classnames({ [styles.signIn]: true })}>Sign Up</li>
            </a>
          </Link>
        </ul>
      </section>
    </main>
  );
};

export default Header;
